import React, { Component } from 'react'

export default class Child_1 extends Component {
  render() {
     let pr= this.props.inncomingProduct
    console.log(pr.price);
     
    return (
      <div className='col-3'>
        <div className='bg-light text-dark'>
          <h2>{pr.name}</h2>
          <h2>{pr.category}</h2>
          <h2>{pr.price}</h2>
          <h2>{pr.stock}</h2>
        </div>
      </div>
    )
  }
}
